/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground, Props } from 'docz'
import AdvanceSearch from '../components/AdvanceSearchDemo';

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "advancesearch"
    }}>{`AdvanceSearch`}</h1>
    <p>{`is a component which allows a user to specify additional requirements for a search.`}</p>
    <h2 {...{
      "id": "properties"
    }}>{`Properties`}</h2>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Property`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Description`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Type`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`Default`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`columns`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`array object of `}<a parentName="td" {...{
              "href": "/editable-table#columns-properties"
            }}>{`columns properties`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`number`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`4`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`fields`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`array object of `}<a parentName="td" {...{
              "href": "/dynamic-element#fields-properties"
            }}>{`DynamicElement Properties`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`boolean`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`firstTabName`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Show text in TabPane's head`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`General`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`activeKey`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Key of the active panel`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string[]`}{`|`}{`string`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`cancelButtonText`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Text of the CANCEL button`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}{`|`}{`ReactNode`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`Cancel`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`searchButtonText`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Text of the SEARCH button`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`string`}{`|`}{`ReactNode`}</td>
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`Search`}</inlineCode></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onCancel`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Specify a function that will be called when a user clicks cancel, close button on top right or CANCEL button`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`function(e)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onSearch`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`Specify a function that will be called when a user clicks button SEARCH`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`function(e)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`-`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "basic-usage"
    }}>{`Basic usage`}</h2>
    <Playground __position={0} __code={'<AdvanceSearch\n  activeKey=\"1\"\n  fields={[\n    {\n      formItem: {\n        label: \'Name\',\n        key: \'name\',\n        colon: false,\n      },\n      decorator: {},\n      element: {\n        placeholder: \'Name\',\n      },\n      type: \'input\',\n      name: \'name\',\n    },\n    {\n      formItem: {\n        label: \'Name 2\',\n        key: \'name_2\',\n        colon: false,\n      },\n      decorator: {},\n      element: {\n        placeholder: \'Name 2\',\n      },\n      type: \'input\',\n      name: \'name_2\',\n    },\n    {\n      formItem: {\n        label: \'Status\',\n        key: \'is_active\',\n        colon: false,\n      },\n      decorator: {\n        rules: [{ required: false }],\n        valuePropName: \'checked\',\n        initialValue: true,\n      },\n      element: {},\n      type: \'switch\',\n      name: \'is_active\',\n    },\n  ]}\n  onSearch={() => console.log(\'OnSearch Clicked\')}\n  onCancel={() => console.log(\'OnCancel Clicked\')}\n/>'} __scope={{
      props: this ? this.props : props,
      Playground,
      Props,
      AdvanceSearch
    }} mdxType="Playground">
    <AdvanceSearch activeKey='1' fields={[{
        formItem: {
          label: 'Name',
          key: 'name',
          colon: false
        },
        decorator: {},
        element: {
          placeholder: 'Name'
        },
        type: 'input',
        name: 'name'
      }, {
        formItem: {
          label: 'Name 2',
          key: 'name_2',
          colon: false
        },
        decorator: {},
        element: {
          placeholder: 'Name 2'
        },
        type: 'input',
        name: 'name_2'
      }, {
        formItem: {
          label: 'Status',
          key: 'is_active',
          colon: false
        },
        decorator: {
          rules: [{
            required: false
          }],
          valuePropName: 'checked',
          initialValue: true
        },
        element: {},
        type: 'switch',
        name: 'is_active'
      }]} onSearch={() => console.log('OnSearch Clicked')} onCancel={() => console.log('OnCancel Clicked')} mdxType="AdvanceSearch" />
    </Playground>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
